import React from "react";
import "bootstrap/dist/css/bootstrap.css";

export function Footer(): JSX.Element {
    return (
        <div className="container-fluid bg-light sticky-bottom">
            <footer className="align-items-center border-t py-3 my-4">
                <span className="col-md-6 mb-0 text-muted">This site was built from scratch in React!</span>
                <p className="col-md-6 mb-0 text-muted">
                    <a className="link-offset-2 link-offset-3-hover link-underline link-underline-opacity-0 link-underline-opacity-75-hover"
                       href="https://github.com/anishmukherjee123/anishmukherjee.info">
                        Repo available here.
                    </a>
                </p>
            </footer>
        </div>
    );
}
